					var option= $(this).attr("data-option");
					var btn = $(this);
					$.ajax({
						type: "POST",
						url: "ajax/spec_report.php",
						data: "action=options&option="+option+"&pid=78121&item_type=2&type="+type,
						beforeSend: function() {
							btn.after("<span class=\"loadingMessage\">Submitting...</span>");
